import React from 'react';
import CoinsScreen from './CoinsScreen';

const stack = createStackNavigator();

const coinsStack = () => {
   return (
    <Stack.Navigator>
        <Stack.Screen name="coins" component={CoinsScreen}/>
    </Stack.Navigator>
   );
}

export default CoinsStack;
